// Modules //
import React from 'react';
import axios from 'axios';
import Fade from 'react-reveal/Fade';

// Style //
import { Container, Col, Row, Card } from 'react-bootstrap';
import './Presentation.scss';

class Main extends React.Component {

  render() {
    return (
      <div className="div_diplomes">
        <Container>
            <h2 className="h2_diplomes">Diplomes et Formations</h2>
            <Row>
            <Fade cascade>
            <Col>
                <h3>Age</h3>
                <p>23 ans</p>
            </Col>
            <Col>
                <h3>Status</h3>
                <p>Enrecherche d'un contrat de profesionnalisation</p>
            </Col>
            <Col>
                <h3>Domaine</h3>
                <p>Developpement Front-End</p>
            </Col>
            <Col>
                <h3>Languages</h3>
                <p>ReactJS</p>
                <p>Javascript</p>
                <p>PHP</p>
            </Col>
            </Fade>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Main;
